import { useSelector } from "react-redux"


export const SearchFilter = (event) => {
    console.log(searchdata)
    return (dispatch) => {
        const searchdata = useSelector((state) => state.array2)
        const ValueStore = []
        for (let i = 0; i >= searchdata.length; i++)
            if (event === searchdata[i]) {
                ValueStore.push(searchdata[i])
            }
        dispatch({
            type: 'searchfilter',
            payload: ValueStore
        })
    }
}
